import { uid } from "uuid";

const arrayTags = [
  "cats",
  "lasagne",
  "movies",
  "gaming",
  "fantasy",
  "cyberpunk",
  "gorillaz",
  "kakao",
  "kazoo",
  "shrek",
];

export default function AboutTags() {
  const listTags = arrayTags.map((element, key) => (
    <li key={uid}>{element}</li>
  ));

  return (
    <section>
      <ul>{listTags}</ul>
    </section>
  );
}
